import { useParams } from "react-router-dom";

function CalendarDetails () {
    const calendar_id = useParams();

    return (
        <div className="container">
            <div className="row">
                <div className="offset-2 col-8">
                   {calendar_id}
                </div>
            </div>
        </div>
    )
}

export default CalendarDetails;
